import React, { useState, useEffect } from "react";
import axios from "axios";

export const Main = () => {
  const [pelis, setPelis] = useState({});

  useEffect(() => {
    axios
      .get("https://www.omdbapi.com/?apikey=20dac387&t=batman")
      .then((response) => response.data)
      .then((data) => setPelis({ pelis: data }));
  }, []);

  return (
    <>
      <h1>{pelis}</h1>
    </>
  );
};
